INSERT INTO legislation (legislation_id, country, datetime, organism, type, name, observation, link, component, created_by, created_datetime, modified_by, modified_datetime) VALUES ('L7', 'Argentina', '2006-11-23 00:00:00+00', 'Estado', 'Ley', '26.160', '26-sept-2017 .En una sesión especial y con 62 votos afirmativos, el Senado de la Nación aprobó por unanimidad la prórroga por cuatro años de la Ley 26.160 de Emergencia Territorial Indígena. El proyecto aprobado ahora deberá ser tratado en Diputados.', 'http://endepa.org.ar/fruto-de-la-lucha-media-sancion-a-la-prorroga-de-la-ley-26-160/', 'avance', 'OTEO_ADMIN_USER', '2017-10-18 16:13:26.657+00', 'OTEO_ADMIN_USER', '2017-10-18 16:13:26.657+00');
INSERT INTO legislation (legislation_id, country, datetime, organism, type, name, observation, link, component, created_by, created_datetime, modified_by, modified_datetime) VALUES ('L8', 'Brasil', '2017-08-17 00:00:00+00', 'Corte Suprema', 'Sentencia', NULL, 'Brasilia La Corte Suprema de Brasil ratificó ayer la constitucionalidad de la cesión de tierras por parte del Estado a las tribus que las han ocupado históricamente, lo que fue celebrado por grupos indígenas como una gran ?victoria de los pueblos originarios?. El pronunciamiento de la corte, de carácter constitucional, había sido pedido por el Gobierno del estado de Mato Grosso, que exigía una indemnización por haberse visto obligado a ceder parte de su territorio para la constitución de reservas indígenas.', 'http://www.dw.com/es/brasil-cesi%C3%B3n-de-tierras-a-ind%C3%ADgenas-es-legal/a-40129369', 'avance', 'OTEO_ADMIN_USER', '2017-10-18 16:13:26.661+00', 'OTEO_ADMIN_USER', '2017-10-18 16:13:26.661+00');
